import React, {useEffect, useState} from 'react';
import {todosLosProductos} from '../funciones/funciones';
import { useTable } from "react-table";



function Chart () {
const [productos, setProductos] = useState(null)
useEffect( () => {
    todosLosProductos(setProductos)
}, [])


    return (
        /* <!-- DataTales Example --> */
        <div className="card shadow">
            <div className="card-body">
                <div className="table-responsive">
                    <table className="table table-bordered" id="dataTable" width="100%" cellSpacing="0">
                    <thead>
                            <tr>
                                <th>ID</th>
                                <th>NAME</th>
                                <th>PRICE</th>
                                <th>DESCRIPTION</th>

                            </tr>
                        </thead> 
                        {productos != null ? (
                            productos.map(producto => (
                                <div key={producto.id}>
                                    <thead>
                                        <tr>
                                            <th>id: {producto.product_id}</th>
                                            <th>Name: {producto.title}</th>
                                            <th>Price: {producto.price}</th>
                                            <th>Description:{producto.description}</th>
                                        </tr>
                                    </thead>
                                </div>
                            ))
                        ) : ('No hay productos')}
                    </table>    
                </div>    
            </div>   
        </div>
    )
}

export default Chart;
